  false,\n\t\"url\": null,\n\t\"notes\": \"These profiles significantly increase the
  amount of information that is available about the performance of CDBG grantees.
  It is important that our grantees, all our stakeholders, and citizens be able to
  access detailed information about the performance of each local CDBG program. This
  access helps ensure accountability and assists in assessing the progress of each
  grantee's program. These profiles also assist grantees in measuring their contributions
  toward meeting the housing and community developments needs of low- and moderate-income
  persons in their communities and in analyzing the effectiveness and efficiency of
  their program.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
